window.bookSummaryJSON = "<p><b>He's going to make me his, but not until I beg for it.</b></p> <p>When Shane Kavanagh waltzed into the Murphy pub as if he owned the place, what set my heart racing wasn't his brash arrogance, his obnoxiously gorgeous eyes, or his scolding yet sexy tone. It wasn't even him promising to spank me and then ravage me the way no man has ever dared.</p> <p>It was how he made me feel like a naughty little girl and a blushing virgin when I was neither.</p> <p>I'm the daughter of a powerful Irish mafia family and he's the boss of a rival organization, but when he rides me with his belt tight around my throat it doesn't make me want to call a hitman.</p> <p>It makes me want to call him daddy.</p> <p><i>Break Me, Daddy</i> is a standalone in the Boston Kings series. Intended for mature listeners.</p>"; 
